import apiURL from "../apiUrl";
import axios from "axios";

const userListURL = apiURL + "user/list/";

const getUserById = (pk) => {
  let users = [];
  axios.get(userListURL + pk).then((res) => users.push(res.data.username));
  console.log(users);
  return users ? users : "Anonymous";
};

export default getUserById;
